import React from "react";

import Projects from "../components/Projects";
import Qa from "../components/Qa";
import more from "../image/last-projects/more.svg";

export default function Main() {
    const items = {
        name: 123,
    }
    return(
        <div>
            <Qa/>
            <Projects/>
            <LastProjects items={items}/>
        </div>
    )
}



class LastProjects extends React.Component {

    render() {
        return(
            <section className="last-projects">
                <div className="last-projects__content _contsiner">
                    <h2 className="last-projects__heading">История</h2>
                    <ul className="last-projects__list">
                    {this.props.items.map(item => (
                    <li key={item.id}>
                        <div className="timer__number">Timer #{item.number}</div>
                        <h2 className="timer__time">
                            {item.hours<10 ? '0' : ''}{item.hours}:
                            {item.minutes<10 ? '0' : ''}{item.minutes}:
                            {item.seconds<10 ? '0' : ''}{item.seconds}
                        </h2>
                    </li>
                ))}
                    </ul>
                </div>
            </section>
        )
    }
}
